import { io, Socket } from 'socket.io-client';

class SocketService {
    static instance: SocketService | null = null;
    socket: Socket | null = null;

    constructor() {
        if (SocketService.instance) {
            return SocketService.instance;
        }
        SocketService.instance = this;
    }

    static getInstance(): SocketService {
        if (!SocketService.instance) {
            SocketService.instance = new SocketService();
        }
        return SocketService.instance;
    }

    initializeSocket(token: string): Promise<Socket> {
        return new Promise((resolve, reject) => {
            if (this.socket) {
                this.socket.disconnect();
            }

            this.socket = io('http://localhost:8080', {  
                path: '/chat/socket.io',  
                auth: { token },
                transports: ['websocket'],
                reconnection: false,  
                forceNew: true,
                query: {
                    userId: localStorage.getItem('userId')
                },
                extraHeaders: {
                    'Authorization': `Bearer ${token}`
                }
            });

            const timeout = setTimeout(() => {
                reject(new Error('Connection timeout'));
                this.socket?.disconnect();
            }, 5000);

            this.socket.on('connect', () => {
                clearTimeout(timeout);
                if (this.socket) {
                    console.log('Socket connected with ID:', this.socket.id);
                    resolve(this.socket);
                } else {
                    reject(new Error('Socket initialization failed'));
                }
            });

            this.socket.on('connect_error', (err) => {
                clearTimeout(timeout);
                console.error('Connection error:', err.message);
                reject(new Error(`Connection failed: ${err.message}`));
            });
        });
    }

    getSocket(): Socket | null {
        return this.socket;
    }

    disconnect(): void {
        if (this.socket) {
            this.socket.disconnect();
            this.socket = null;
        }
    }
}

// Create and export a singleton instance
export const socketService = new SocketService();

export const sendMessage = (message: { text: string; userId: string }) => {
    if (socketService.getSocket()) {
        socketService.getSocket()?.emit('message', message);
    } else {
        console.error('Socket is not connected');
    }
};

export const onMessageReceived = (callback: (message: any) => void) => {
    if (socketService.getSocket()) {
        socketService.getSocket()?.on('message', callback);
    }
};

